import styled from "styled-components";

function Menu() {

    return (
        <Container>
         <h1>Menu</h1>
        </Container>
    )
}

const Container = styled.div`
    font-family: 'Lexend Deca', sans-serif;
    width: 375px;
    height: 70px;
    display: flex;
    bottom: 0;
    left: 0;
    background-color: #FFFFFF;

`

export default Menu;
